彩度や風合いを追求したカラーパレット。ペットとの暮らしも快適に。<br><br>
　ベーシックカラーやモノトーン、発色の良いアクセントカラーなど、他にはない個性的なラインアップを揃えました。<br>
　組み合わせ次第で多彩なオリジナルデザインが完成します。<br>
　ペットの爪にひっかかりにくいカットパイル、気になる臭いを消臭するエアファイン加工で、ペットと暮らすご家庭にもおすすめです。<br><br>
●<font color="#ff0000" size="+1" style="font-size : 20px;">ご注文は10枚以上1枚単位での販売となります。</font><br><br>
